import React from 'react';
import Footer from '../components/footer';
import Jumbotron from '../components/jumbotron';
import Navbar from '../components/navbar';
import Wrapper from '../components/wrapper';
// import createAccountModal from '../components/createAccountModal'
// import LoginModal from '../components/loginModal'
// import Form from '../components/form'
import Container from '../components/container';
import Col from '../components/col';
import Row from '../components/row';

function Home() {
	return (
		<div>
			<Navbar />
			<Container style={{ marginTop: 50 }}>
				<Row>
					<Col size="md-12">
						<Jumbotron />
					</Col>
				</Row>

				<Row>
					<Col size="md-12">
						<div className="images" style={{ marginTop: 50 }}>
							<img src="https://blznav.akamaized.net/img/games/cards/card-world-of-warcraft-54576e6364584e35.jpg" />
							<img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSDnNvJiRs2vPjPEwkkz1IqqwHOHivkq-av8UKRkDHQbhvjtmC_RA" />
							<img src="https://pbs.twimg.com/media/D9iZq-yWkAA0tT0.jpg" />
							<img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSOQX8r3SbKCnxQk_wfbTDKniferM0gMFlEws_Fvp3xHDzHUsbPeA" />
						</div>
					</Col>
				</Row>

				<Footer />
			</Container>
		</div>
	);
}

export default Home;
